import React, {useContext}from 'react'
import Link from 'next/link'
import styles from './index.module.css'
import useLogin from 'client/components/useLogin'

const user = {login: false, name: 'haha'}
export const UserContext = React.createContext(user)

export default function Index() {
  const [isLogin, userLogin, userLogout] = useLogin()

  const test = useContext(UserContext)
  console.log('userContext=')
  console.log(UserContext)
  console.log(test.login)
  console.log(test.name)
  test.login = true

  const test2 = useContext(UserContext)
  console.log(test2.login)
  return (
    <>
      <UserContext.Provider value={test2}>
        <div className={styles.nav}>
          <Link href="/"><a>Home</a></Link>
          <h1>MAC posts</h1>
          <Link href="/login"><a>Log In</a></Link>
        </div>
        <p>Hello Next.js, this is your friend Brian from logrooooooddddddocket</p>
        <Link href="/posts/page"><a>test</a></Link><br/>
      </UserContext.Provider>
    </>
  )
}
